import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { BusinessRoutingComponent } from './business-routing.component';

const routes: Routes = [{ path: '', component: BusinessRoutingComponent }];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class BusinessRoutingRoutingModule { }
